import sys
import os
import random
import base64
import pygame
import tkinter
from tkinter import messagebox

# 打散圖片
def rand_map(map):
    for i in range(1000):
        x = random.randint(0, 2)
        y = random.randint(0, 2)
        move(x, y, map)

# 圖片移動
def move(x, y, map):
    if y - 1 >= 0 and map[y - 1][x] == 8:
        map[y][x], map[y - 1][x] = map[y - 1][x], map[y][x]
    elif y + 1 <= 2 and map[y + 1][x] == 8:
        map[y][x], map[y + 1][x] = map[y + 1][x], map[y][x]
    elif x - 1 >= 0 and map[y][x - 1] == 8:
        map[y][x], map[y][x - 1] = map[y][x - 1], map[y][x]
    elif x + 1 <= 2 and map[y][x + 1] == 8:
        map[y][x], map[y][x + 1] = map[y][x + 1], map[y][x]

# 視窗尺寸
width = height = 600;

# 背景底色
bg_color = (255, 255, 255)

# 背景圖片透明度
opacity = 100

# 拼圖預設位置
img_map = [
    [0, 1, 2],
    [3, 4, 5],
    [6, 7, 8]
]

# 拼圖勝利位置
win_map = [
    [0, 1, 2],
    [3, 4, 5],
    [6, 7, 8]
]

# 建立 tkinter 物件
root = tkinter.Tk()

# 隱藏tkinter主視窗
root.withdraw()

# 使彈出視窗置頂
root.wm_attributes('-topmost',1)

# 取得螢幕寬與高
window_width = root.winfo_screenwidth()
window_height = root.winfo_screenheight()

# 計算 x 與 y 位置
window_x = int(window_width / 2) - int(width / 2)
window_y = int(window_height / 2) - int(height / 2)

# 設定視窗位置
os.environ['SDL_VIDEO_WINDOW_POS'] = '%d,%d' % (window_x, window_y)

# 遊戲視窗初始化
pygame.init()

# 視窗標題
pygame.display.set_caption('Code dog puzzle')

# 視窗尺寸
window = pygame.display.set_mode((width, height))

# base64 編碼轉圖片
codedog_img = open('codedog.jpg', 'wb+')
codedog_img.write(base64.b64decode(b''))
codedog_img.close()

# 載入拼圖圖片
img = pygame.image.load('codedog.jpg')

# 載入背景圖片
bg_img = pygame.image.load('codedog.jpg')

os.remove('codedog.jpg')

# base64 編碼轉icon
logo_icon = open('logo.ico', 'wb+')
logo_icon.write(base64.b64decode(b''))
logo_icon.close()

# 設定 icon
pygame.display.set_icon(pygame.image.load('logo.ico'))

os.remove('logo.ico')

# 打散圖片
rand_map(img_map)

while True:

    # 延遲40毫秒
    pygame.time.delay(40)
    for event in pygame.event.get():

        # 離開
        if event.type == pygame.QUIT:
            sys.exit()

        # 滑鼠事件
        elif event.type == pygame.MOUSEBUTTONDOWN:
            if pygame.mouse.get_pressed() == (1, 0, 0):
                mx, my = pygame.mouse.get_pos()

                # 點擊位置小於視窗位置
                if mx < width and my < height:
                    x = int(mx / 200)
                    y = int(my / 200)

                    # 禁止移動拼圖
                    if img_map == win_map:
                        pygame.event.set_blocked(pygame.MOUSEMOTION)
                        messagebox.showinfo('Message', 'Finish~')

                    # 移動拼圖
                    else:
                        move(x, y, img_map)

    # 背景底色設定白色
    window.fill(bg_color)

    # 設定圖片並淡化
    bg_img.set_alpha(opacity)

    window.blit(bg_img, (0, 0))
    for y in range(3):
        for x in range(3):
            i = img_map[y][x]

            # 拼圖未完成
            if img_map != win_map:
                if i == 8:
                    continue

                # 計算圖片位置
                dx = (i % 3) * 200
                dy = (int(i / 3)) * 200
                window.blit(img, (x * 200, y * 200), (dx, dy, 200, 200))

            # 拼圖完成
            else:
                window.blit(img, (0, 0))

    # 刷新畫面
    pygame.display.flip()